(56782, 2307, 5357, 9, 'Passerby', '', '2012-12-01 00:00:00', 2000, 20, 0, 7, '', '作詞：盧志宏\n作曲：盧志宏\n\nI should''ve known there''s a line\nTo divine us from step too closer\nYou hit the sign, but I ignore\nAnd try to cross\n\nCause we don''t have tomorrow\n\nI''m your passerby\nI''m just your passerby\n\nI''ve never known how to play this game\nDon''t even care if I''ll be the loser\nLike shooting stars shine then gone\nOur relationship\n\nCause we don''t have tomorrow\n\nI''m your passerby\nI''m just your passerby\n\nI''ve been living in fool''s paradise\nNow I''m gonna leave this all behind\n\nI''m your passerby\nI''m just your passerby\n\n\n我早該知道\n我們之間有一條界線，將我們分隔\n保持著妳我的距離\n妳已經打了信號\n但是我故意忽略，還試著去跨越\n\n因為我倆沒有明天\n\n我是妳的過客\n我只是妳旅途中的一個過客\n\n我從不知道，該如何玩這個遊戲\n甚至也不在乎我將會是輸家\n我們的關係，就像流星一般\n稍縱即逝\n\n因為我倆沒有明天\n\n我是妳的過客\n我只是妳旅途中的一個過客\n\n我一直都被蒙在鼓底\n現在我要把這一切拋諸腦後\n\n我是妳的過客\n我只是妳旅途中的一個過客\n', 276, '', '', '', '', '', '', 0, 1, 0, '2012-12-06 14:17:02', '2015-03-12 13:57:17', '0000-00-00 00:00:00'),
