(56839, 162885, 0, 1, 'sparkling(demo)', 'http://www.facebook.com/thenoband', '2012-12-07 00:00:00', 2011, 0, 1, 7, '也許今天你不知道我是誰　 But I just stand here again\r\n幻想哪天會是我的stage day   期許我自己改變\r\n\r\n我試著 高喊著 高喊我那份奮鬥\r\n我用力 去嘗試 這份心動 這份悸動\r\n\r\n這時候 所有的 時空瞬間都停留\r\n既然心動 不怕受痛 去衝\r\n\r\n這生活充滿太多考驗 等我解\r\n勇敢去衝 不畏懼難過 That just like role play game\r\n\r\n這份悸動讓我充分瞭解 這世界\r\n再不行動 時間就過 我依然不閃爍', '', 320, '', 'The NO', 'The NO', 'The NO', 'The NO', '', 0, 1, 0, '2012-12-07 02:56:15', '2015-03-12 13:57:19', '0000-00-00 00:00:00'),
