(56842, 10394, 5346, 1, '別再', '[別再]批判著某些人為了達成自我認同或族群依歸、刻意使用艱澀複雜的文詞字句對外溝通表達，裝模作樣、辭不達意。這些自視甚高的人們有如被自己的文句綁架、跳脫不出文字遊戲的無限迴圈，不僅造成人與人之間的溝通障礙，也是許多社會怪象的根源。HiJack以「別再」這首歌戳破這個高貴族群的謊言，期待每個人都能重新認識且認同真實的自我。', '2012-11-30 00:00:00', 2012, 19, 0, 7, '一個造神的世界\r\n誰在拼命裝瞭解\r\n過於擁擠的迴圈\r\n跳脫不出這侷限\r\n\r\n漠不關已地拒絕\r\n相互溝通的一切\r\n嘲弄著眼中異類\r\n難道這樣才算美\r\n\r\n使用著艱深的字句 有什麼意義\r\n想要表達的事情 卻變得更不清晰\r\n說不出內心的感受 有什麼意義\r\n那些虛無的話語 發不出任何聲音（控制著想像）\r\n\r\n什麼時候才能明白\r\n這唯一真實	的存在\r\n再也沒有任何人可以被取代\r\n什麼時候才能明白\r\n為了證明自己存在\r\n拋下每個無謂的對白\r\nGood bye\r\n\r\n再也忍受不了\r\n拼湊著字句卻了解多少\r\n再也受不了\r\n未免太可笑\r\n無法卸下卻沈溺在這種偽裝\r\n', '', 294, '', '蔡明諺', '蔡明諺', '鄭平, 蔡明諺, 陳佑, 劉曉蓉, 李東祐', '', 'TWAE31400130', 1, 1, 0, '2012-12-07 13:42:16', '2015-03-12 13:57:19', '0000-00-00 00:00:00'),
(56843, 10394, 5346, 2, '旅程記錄', '[旅程記錄]是HiJack成軍四年多以來的歷程回顧，寫出此時此刻回首過往的五味雜陳，也大聲唱著逐步邁向目標的堅定意志，不再迷網。這首歌不僅獻給HiJack自己，更要獻給所有正在追逐理想路程中的朋友—我們的旅程記錄，不論終點如何，都已在心裡刻劃出深刻的印記！', '2012-11-30 00:00:00', 2012, 19, 0, 4, '擦身而過的渺小 (最想說的一句話)\r\n越靠越近的目標 (卻一直放在心上)\r\n落在背後的每個記憶都已刻劃在腳印裡\r\n這樣繼續蔓延下去\r\n\r\n我們都試著去尋找這稍縱即逝的希望\r\n期待過後每個落差漸漸地被熱情融化\r\n也許自以為的主張推翻著每一種想像\r\n不被誰而阻擋\r\n(不許對自己說謊)\r\n', '', 212, '', '蔡明諺', '蔡明諺', '鄭平, 蔡明諺, 陳佑, 劉曉蓉, 李東祐', '', 'TWAE31400131', 1, 1, 0, '2012-12-07 13:42:39', '2015-03-12 13:57:19', '0000-00-00 00:00:00'),
