(56847, 14996, 5362, 1, '流行搖滾', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞：鳥蛋／老滕 曲：鳥蛋\r\n\r\nHey Party Girl, \r\n妳有一種脫俗的美麗，城市因為妳顯得擁擠，讓我難以穿越的人群。\r\nI Wanna Know,\r\n是否妳那濃妝的眼睛，看穿了我的特立獨行，只是引妳注意的叛逆？\r\n\r\n戒掉華麗速彈炫技，卸下龐克的面具，\r\n剪去長髮抹去刺青，為你譜一曲，輕柔順耳的流行搖滾樂。\r\n\r\nHey Listen Girl,\r\n所有現在編織的美夢，在那一瞬間它告訴我，為妳而改變不是懦弱。\r\nOh Rock and Roll,\r\n可以是頭溫馴的野獸，伸出妳那時尚的雙手，為我套上幸福的枷鎖。\r\n\r\nHip-Hop, 街頭太過躁鬱，斬斷放克的彈力，\r\n戴上文藝黑框眼鏡，為妳譜一曲，詩情畫意的流行搖滾樂。\r\n\r\n等妳為我，Lose Control，當我彈奏，這流行搖滾樂，\r\n等妳為我，Lose Control，當我彈奏，這流行搖滾樂！\r\n\r\n剪去長髮抹去刺青，跳過這些浪漫遊戲，\r\n摘下文藝黑框眼鏡，直接唱一曲，專屬於妳的流行搖滾樂。\r\n', '', 241, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:12:03', '2015-03-12 13:57:19', '0000-00-00 00:00:00'),
(56848, 14996, 5362, 2, '水某', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞曲：鳥蛋\r\n\r\n一句甘甜，說未出口，想起初戀彼時，那多熱情。\r\n看著相片，妳的笑容，那會感覺這遠，我是欲找誰去問？\r\n\r\n那會變按捺，感覺未透尾，為著什麼原因，感覺空虛。\r\n那會變按捺，干擱愛作伙，我的心內甘那妳一個。\r\n\r\n水某，我唯一的幸福，我也甘願為妳，來奔波走衝。\r\n水某，在愛情這條路，我也甘願為妳癡，甘願為妳憨。\r\n\r\n秋夜河畔，阮的咒詛，呼妳未擱孤單，未受風寒。\r\n世事拖磨，環境變化，雖然天地這闊，哪無妳我不是我。\r\n\r\n真情愛攏是空，甘有影？\r\n不願意一場夢，請妳千萬嘸倘⋯⋯\r\n\r\n那會變按捺，感覺未透尾，為著啥米原因，感覺空虛。\r\n那會變按捺，不願擱作伙，咱的世界只剩我一個。\r\n\r\n水某，我唯一的幸福，我也甘願為妳，淋著這場小雨。\r\n水某，在愛情這條路，我也甘願為妳癡，甘願為妳憨。\r\n\r\n水某～水某～水某～我也甘願為妳憨。\r\n水某～水某～水某～我也甘願為妳憨。\r\n\r\n妳的笑容，感覺這麼遠⋯⋯\r\n', '', 303, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:12:34', '2015-03-12 13:57:19', '0000-00-00 00:00:00'),
(56849, 14996, 5362, 3, '摩托車', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞：小新／老滕  曲：小新\r\n\r\n我有一台舊舊的摩托車，帶我去感受真實的冷漠，\r\n快樂又墮落橫跨南美洲，再見舊帝國革命全地球。\r\n\r\n我有一台舊舊的摩托車，有一個女孩曾經是乘客，\r\n人生總會有分開的時候，讓你去追求下車的路口。\r\n\r\n帶我走帶我走，我要拋開你的所有，\r\n帶我走帶我走，留下淡淡的哀愁，\r\n帶我走帶我走，妳的懷中沒有我，\r\n帶我走帶我走，摩托車帶我走。\r\n\r\n帶我走帶我走，我要拋開你的所有，\r\n帶我走帶我走，面對未知的折磨，\r\n帶我走帶我走，找回孩子的笑容，\r\n帶我走帶我走，衣衫上的英雄。\r\n\r\n我有一台舊舊的摩托車，帶我去穿梭喧鬧的街頭，\r\n開始到最後我都要經過，帶我走帶我走，我的摩托車。', '', 292, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:13:13', '2015-03-12 13:57:20', '0000-00-00 00:00:00'),
(56850, 14996, 5362, 4, '桐花雨', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞曲：老滕\r\n\r\n我是一片漂泊灰暗的雲海，雨落下來，淹沒許多色彩；\r\n妳是一片凋零破碎的桐花海，我落下來，滋潤妳的純白；\r\n看見妳的綻放，我留下來。\r\n\r\n妳說我給你的愛是片雲彩，雨落下來，灌溉許多期待；\r\n我說妳給我的愛使烏雲散開，妳落下來，襯托我的蔚藍；\r\n但放晴後的日子，花期不再。\r\n\r\n我不知道為什麼雨季不來？我不知道為什麼滿地花瓣？\r\n我不知道為什麼，喔為什麼，我們互相傷害，\r\n任由妳的枯萎，看著我的消散？\r\n\r\n只能在大雨來臨之前風乾哭泣的臉，\r\n但每個寧靜夜裡，澎湃聲音，告訴我，妳還愛我\r\n我想，祈求上天讓祂釋放我的淚\r\n告訴我為什麼，妳為什麼？我為什麼？\r\n\r\n為什麼？天為什麼，為什麼？為我淚流。', '', 348, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:13:53', '2015-03-12 13:57:20', '0000-00-00 00:00:00'),
(56851, 14996, 5362, 5, '好茶村的夏天', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞曲:鳥蛋\r\n\r\n這是雲豹的故鄉  也是文明的邊疆\r\n守護著最後一片屋瓦  她不走\r\n南太平洋的風暴  等待是一種煎熬\r\n脆弱的雙手抵擋不了  大雨滂沱\r\n\r\n每一天每一天我祈禱  每一年每一年這小島\r\n能繼續站穩腳步面對白色的氣旋\r\n親愛的土地我的母親  我是妳被放逐的子民\r\n金黃色的河流吞沒了祖先的森林\r\n\r\n城市的孩子放假  他們帶孩子離家\r\n收容所裡的床邊故事  失去顏色\r\n無可奈何的撤離  未完成的豐年祭\r\n電影院裡的城市人們  不會懂\r\n\r\n每一天每一天我祈禱  每一年每一年這小島\r\n能繼續站穩腳步面對白色的氣旋\r\n親愛的土地我的母親  我是妳被放逐的子民\r\n金黃色的河流吞沒了祖先的森林\r\n\r\n摧毀  摧毀  摧毀  這下雨天  和過去所有光榮的歲月', '', 212, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:14:30', '2015-03-12 13:57:20', '0000-00-00 00:00:00'),
(56852, 14996, 5362, 6, '你現在可以吻新娘了', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞：鳥蛋/老滕  曲：鳥蛋\r\n \r\n你的眼神告訴我，你認真了，\r\n從此你會缺席我的喧鬧至凌晨；\r\n我的預感告訴我，要成真了，\r\n用相知相守告別荒唐青春。\r\n\r\n你是否會為她笑而笑，為她哭而哭？\r\n從一而終，患難與共，年少到白頭？\r\n溫暖她的手，成就她的夢，\r\n如果以上就是你的承諾？\r\n\r\n你現在可以吻新娘了，越過漫長的等待，\r\n原來過去所有空白，都是為她虛位以待；\r\n吻新娘吧，染上她的唇彩⋯⋯\r\n\r\n計算命運的星座是否契合，\r\n有時兩個人只需要包容和信任；\r\n邁向幸福的旅程，歷經坎坷，\r\n用相知相守共渡千萬個銀河。\r\n\r\n你現在可以吻新娘了，越過漫長的等待，\r\n原來過去所有空白，都是為她虛位以待；\r\n吻新娘吧，染上她的唇彩，\r\n從此不會再孤單～\r\n', '', 291, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:15:05', '2015-03-12 13:57:20', '0000-00-00 00:00:00'),
(56853, 14996, 5362, 7, '女孩走吧(Remastered 2009 Production)', '', '2012-12-08 00:00:00', 2000, 0, 2, 4, '詞曲：老滕\r\n\r\n我怎不難過 當妳說妳要離開我\r\n我怎不傷痛 當妳的誓言已落空\r\n\r\n啊~~~~讓妳走 給妳自由 別再回頭\r\n啊~~~~這是我 唯一的要求 記得我 最後的溫柔\r\n\r\n我毫無保留 當我已付出我所有\r\n我絕不強求 當我已決定向前走\r\n\r\n啊~~~~讓妳走 給我解脫 失去了寄託\r\n啊~~~~這是我 勇敢的失落 記得妳 永遠的笑容\r\n\r\n我走到最後 下雨街頭依然落寞\r\n但我無所求 付出後的收穫 總是多\r\n\r\n啊~~~~讓妳走 給妳自由 別再回頭\r\n啊~~~~這是我 唯一的要求 記得我 最後的溫柔\r\n\r\n女孩走吧~~~~', '', 259, '', '', '', '', '', '', 1, 1, 0, '2012-12-07 20:15:33', '2015-03-12 13:57:20', '0000-00-00 00:00:00'),
